export default function LogIn() {
    return (
        <Flex flexDirection={'column'} width={'100%'}>
           <Input placeholder="login" marginBottom={'5%'}/>
           <Input placeholder="password" />
           <Flex marginTop={'5%'}></Flex> 
        </Flex>
    )
}
